docs/tutorial/counter.html.body:
Counter
We start by the simple example of a counter. A counter does not have asynchronous actions so Redux Ship is not necessary here, but it helps to get started.


Create a React application
Model
View
Controller
Wrapping everything up
Snapshots

Create a React application
Use create-react-app to create a counter application:
create-react-app counter
You should have the following files in src/:
App.css
App.js
App.test.js
index.css
index.js
logo.svg
Install Redux and Redux Ship with their dev tools:
npm install --save redux redux-ship redux-logger redux-ship-logger babel-polyfill
Optionally setup the Flow type system:
npm install -g flow-bin
flow init
flow
Model
We add a model.js file to describe the "Redux part" of the counter:
// @flow
export type State = number;

export const initialState = 0;

export type Commit = {
  type: 'Increment',
} | {
  type: 'Decrement',
};

export function reduce(state: State, commit: Commit): State {
  switch (commit.type) {
  case 'Increment':
    return state + 1;
  case 'Decrement':
    return state - 1;
  default:
    return state;
  }
}

This describes a quite standard reducer with typing. Notice that we name the actions Commit. This is to make clear that these actions are used to modify the state, by opposition to asynchronous actions.
View
In App.js we add the view of the counter:
// @flow
import React, { PureComponent } from 'react';
import './App.css';
import * as Controller from './controller';
import * as Model from './model';

type Props = {
  dispatch: (action: Controller.Action) => void,
  state: Model.State,
};

export default class App extends PureComponent {
  handleClickIncrement = (): void => {
    this.props.dispatch({type: 'ClickIncrement'});
  };

  handleClickDecrement = (): void => {
    this.props.dispatch({type: 'ClickDecrement'});
  };

  render() {
    return (

        {this.props.state}

          +1


          -1


    );
  }
}

We display the value of the counter with {this.props.state}. To handle the clicks on the buttons +1 and -1 we dispatch actions to the controller.
Controller
We define the controller in controller.js:
// @flow
import * as Ship from 'redux-ship';
import * as Model from './model';

export type Action = {
  type: 'ClickIncrement',
} | {
  type: 'ClickDecrement',
};

export function* control(action: Action): Ship.Ship {
  switch (action.type) {
  case 'ClickIncrement':
    yield* Ship.commit({type: 'Increment'});
    return;
  case 'ClickDecrement':
    yield* Ship.commit({type: 'Decrement'});
    return;
  default:
    return;
  }
}

The controller describes how to react to the application events, here a click on +1 or -1. We define a type Action which is the type of all these application events. The function control handles an action by returning a ship.
A ship is the description of a side effect, including API calls, modifications of the Redux state, timers, url update, or calls to third-party libraries with side effects. By side effect we mean "anything which is not purely functional". We define a ship with a generator and Redux Ship primitives.
We call:
yield* Ship.commit({type: 'Increment'});

to commit a commit to the Redux state. All functions in Redux Ship are called with yield*, you should never encounter a yield. We avoid the yield operator because it is a difficult to type in Flow, and instead call proxy functions with yield*.
The return type of control is:
Ship.Ship

meaning that this controller is attached to our model. We could not for example run:
yield* Ship.commit({type: 'Foo'}); // error

as this would result in a Flow type error since {type: 'Foo'} is not of type Model.Commit.
Wrapping everything up
We instantiate a Redux store together with the Redux Ship middleware in store.js:
// @flow
import {applyMiddleware, createStore} from 'redux';
import * as Ship from 'redux-ship';
import createLogger from 'redux-logger';
import {logControl} from 'redux-ship-logger';
import * as Controller from './controller';
import * as Model from './model';

function runEffect() {}

const middlewares = [
  Ship.middleware(runEffect, logControl(Controller.control)),
  createLogger(),
];

export default createStore(
  Model.reduce,
  Model.initialState,
  applyMiddleware(...middlewares)
);

We provide two parameters to the Ship.middleware function:

runEffect which is empty for now, as we only have synchronous actions;
logControl(Controller.control)) which is our controller. We wrap it with a logControl to add loggin to the Redux Ship actions.

We bootstrap the application in index.js:
// @flow
import 'babel-polyfill';
import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './index.css';
import store from './store';

function render(): void {
  ReactDOM.render(
    ,
    document.getElementById('root')
  );
}

store.subscribe(render);
render();

We define a React render function to render the application. We subscribe to the store to re-render when the Redux store is updated. Note that you can also use react-redux to connect React to Redux.
Snapshots
When we look at our browser's console we see something like:

We have an action {type: 'Increment'} which takes us from the state 0 to the state 1. This action is logged by redux-logger. We also have a line:
control @ 19:35:41.214 ClickIncrement
which is the log of our controller as given by redux-ship-logger. We see the snapshot of our controller:
[
  {
    type: 'Commit',
    commit: {type: 'Increment'}
  }
]

which is an array of one element, the commit of {type: 'Increment'}, describing all what the controller has done. Nothing fancy there, but the snapshots of our controllers will become increasingly useful as we design more complex controllers.
Let us move to the HTTP Request section to see how to make asynchronous actions.

docs/tutorial/http-request.html.body:
HTTP Request
Most useful Javascript applications run asynchronous actions with side effects. To see how to make it in Redux Ship, we take the example of an application retreiving the color of the eye of R2-D2 with the Star Wars API.


Model
View
Controller
Effect
Snapshots

Model
We start by the definition of the model.js:
// @flow
export type State = {
  color: ?string,
  isLoading: bool,
};

export const initialState: State = {
  color: null,
  isLoading: false,
};

export type Commit = {
  type: 'LoadStart',
} | {
  type: 'LoadSuccess',
  color: string,
};

export function reduce(state: State, commit: Commit): State {
  switch (commit.type) {
  case 'LoadStart':
    return {
      ...state,
      isLoading: true,
    };
  case 'LoadSuccess':
    return {
      ...state,
      color: commit.color,
      isLoading: false,
    };
  default:
    return state;
  }
}

The state is formed of:

a color, which is either a string if color is known or null;
a flag isLoading to know if a request is pending.

We can change the state by beginning of finishing a request.
View
We define a view based on this model:
// @flow
import React, { PureComponent } from 'react';
import * as Controller from './controller';
import * as Model from './model';

type Props = {
  dispatch: (action: Controller.Action) => void,
  state: Model.State,
};

export default class Eye extends PureComponent {
  handleClickLoad = (): void => {
    this.props.dispatch({type: 'ClickLoad'});
  };

  render() {
    return (

        Eye
        {this.props.state.color && {this.props.state.color}}

          {this.props.state.isLoading ? 'Loading...' : 'Get color'}


    );
  }
}

We dispatch the action {type: 'ClickLoad'} each time we click on the button.
Controller
Our controller controller.js implements the ClickLoad action:
import * as Ship from 'redux-ship';
import * as Effect from './effect';
import * as Model from './model';

export type Action = {
  type: 'ClickLoad',
};

export function* control(action: Action): Ship.Ship {
  switch (action.type) {
  case 'ClickLoad': {
    yield* Ship.commit({type: 'LoadStart'});
    const r2d2 = yield* Effect.httpRequest('http://swapi.co/api/people/3/');
    const eyeColor = JSON.parse(r2d2).eye_color;
    yield* Ship.commit({type: 'LoadSuccess', color: eyeColor});
    return;
  }
  default:
    return;
  }
}

We successively:

commit that we are starting the request with yield* Ship.commit({type: 'LoadStart'});
make the HTTP request with yield* Effect.httpRequest('http://swapi.co/api/people/3/');
commit the result with yield* Ship.commit({type: 'LoadSuccess', color: eyeColor})

The function Effect.httpRequest is user-defined, and we now see how to define it.
Effect
One of the aims of Redux Ship is to serialize all the side effects to get better programming tools. In particular, we define the serialization of the primitives effects of our application in a file effect.js. The type Effect is the type of the serialized effects:
export type Effect = {
  type: 'HttpRequest',
  url: string,
};

Our example only runs HTTP requests parametrized by a string, but we could have as many different kinds of effects as needed.
We give meaning to these effects by defining how to run them:
export async function run(effect: Effect): Promise {
  switch (effect.type) {
  case 'HttpRequest': {
    const response = await fetch(effect.url);
    return await response.text();
  }
  default:
    return;
  }
}

The run function must return the promise of the expected result of each effect. We use this function as the runEffect parameter of Ship.run:
function dispatch(action: Controller.Action): void {
  Ship.run(Effect.run, store, logControl(Controller.control)(action));
}

To simplify the use of our effects, we also create functions to wrap the calls to our effects. In our case, we only have the HTTP request:
export function httpRequest(
  url: string
): Ship {
  return Ship.call({
    type: 'HttpRequest',
    url,
  });
}

Notice the type of httpRequest. It means that for any Redux store with commits (or patches) of type Commit and states of type State, an HTTP request is a ship wich returns a string doing some primitive effects of type Effect.
In contrast, the type of Ship.call:
(
  effect: Effect
): Ship

returns a result of type any. Thus, by defining the function httpRequest we specify the return type of the effect HttpRequest to be a string. For consistency, this must be the same type as the return type of the function run on a HttpRequest effect. If the types are not the same, then you may get type errors at runtime.
A general recommendation is to try to have the smallest possible type for Effect to reduce the number of primitives. For example, make one primitive effect for the HTTP requests and then define the different API calls on top of it, rather than one primitive effect per API call.
Snapshots
When we click on the button to get the color of the eye of R2-D2, we get the following snapshot in the logs of redux-ship-logger:
[
  {
    "type": "Commit",
    "commit": {
      "type": "LoadStart"
    }
  },
  {
    "type": "Effect",
