docs/tutorial/composition.html.body:
Composition
Most Javascript applications contain many components. Each of the components can have its own view, its own local state and run some asynchronous actions like API requests. We present how to compose isolated components in Redux Ship as in Elm, thanks to the Ship.map primitive. The code of this tutorial is in examples/http-request.


Components
Model
View
Controller
Snapshots
What we gain

Components
We compose two components with some API calls to SWAPI:

eye which gets the color of the eye of R2-D2;
movies which gets the list of movies of R2-D2.

Each component has its own folder with three files:

model.js (the Redux part);
view.js (the React part);
controller.js (the Redux Ship part).

See src/eye and src/movies for the sources of the components.
Model
The model of the main application regroups the model of each component.
// @flow
import * as EyeModel from './eye/model';
import * as MoviesModel from './movies/model';

export type State = {
  eye: EyeModel.State,
  movies: MoviesModel.State,
};

export const initialState: State = {
  eye: EyeModel.initialState,
  movies: MoviesModel.initialState,
};

export type Commit = {
  type: 'Eye',
  commit: EyeModel.Commit,
} | {
  type: 'Movies',
  commit: MoviesModel.Commit,
};

export function reduce(state: State, commit: Commit): State {
  switch (commit.type) {
  case 'Eye':
    return {
      ...state,
      eye: EyeModel.reduce(state.eye, commit.commit),
    };
  case 'Movies':
    return {
      ...state,
      movies: MoviesModel.reduce(state.movies, commit.commit),
    };
  default:
    return state;
  }
}

The state of the main application is a plain object with two fields containing the states of the eye component and of the movies component. A commit of the main application is either a commit for the eye component or for the movies component. The job of the reducer is to call the right sub-reducer on the right sub-state.
View
The main view includes the view of each sub-component.
// @flow
import React, { PureComponent } from 'react';
import * as EyeController from './eye/controller';
import Eye from './eye/view';
import * as MoviesController from './movies/controller';
import Movies from './movies/view';
import * as Controller from './controller';
import * as Model from './model';

type Props = {
  dispatch: (action: Controller.Action) => void,
  state: Model.State,
};

export default class Index extends PureComponent {
  handleDispatchEye = (action: EyeController.Action): void => {
    this.props.dispatch({type: 'Eye', action});
  };

  handleDispatchMovies = (action: MoviesController.Action): void => {
    this.props.dispatch({type: 'Movies', action});
  };

  render() {
    return (

        Eye

        Movies


    );
  }
}

The composition of the views is simplified by the use of React. However, we must be cautious to provide the correct props to the children components. We compute the state property by extracting the sub-state the component is interested in. We compute the dispatch property by lifting actions of the component to actions of the application. This brings use to the definition of the controller.
Controller
We compose the controllers of eye and movies in one controller for the whole application:
// @flow
import * as Ship from 'redux-ship';
import * as EyeController from './eye/controller';
import * as MoviesController from './movies/controller';
import * as Model from './model';

export type Action = {
  type: 'Eye',
  action: EyeController.Action,
} | {
  type: 'Movies',
  action: MoviesController.Action,
};

export function* control(action: Action): Ship.Ship {
  switch (action.type) {
  case 'Eye':
    return yield* Ship.map(
      commit => ({type: 'Eye', commit}),
      state => state.eye,
      EyeController.control(action.action)
    );
  case 'Movies':
    return yield* Ship.map(
      commit => ({type: 'Movies', commit}),
      state => state.movies,
      MoviesController.control(action.action)
    );
  default:
    return;
  }
}

We define an application action as being either an action for the eye component or an action for the Movies component. The control function takes care to dispatch the right action to the right sub-controller. Because the sub-controllers does not have access to the same state and patches, we need to wrap them with the Ship.map primitive. Indeed, the ship:
EyeController.control(action.action)

is of type:
Ship.Ship

but we want to return a controller of the following type:
Ship.Ship

With the Ship.map primitive, we lift the eye controller to the right type:
Ship.map(
  commit => ({type: 'Eye', commit}),
  state => state.eye,
  EyeController.control(action.action)
)

We declare:

how to lift a commit of the eye controller to a commit of the application controller;
how to extract the state of the eye controller from the state of the application controller.

Snapshots
We get the following snapshot when clicking on the eye button:
[
  {
    "type": "Commit",
    "commit": {
      "type": "Eye",
      "commit": {
        "type": "LoadStart"
      }
    }
  },
  {
    "type": "Effect",
    "effect": {
      "type": "HttpRequest",
      "url": "http://swapi.co/api/people/3/"
    },
    "result": "{\"name\":\"R2-D2\",\"height\":\"96\",\"mass\":\"32\",\"hair_color\":\"n/a\",\"skin_color\":\"white, blue\",\"eye_color\":\"red\",\"birth_year\":\"33BBY\",\"gender\":\"n/a\",\"homeworld\":\"http://swapi.co/api/planets/8/\",\"films\":[\"http://swapi.co/api/films/5/\",\"http://swapi.co/api/films/4/\",\"http://swapi.co/api/films/6/\",\"http://swapi.co/api/films/3/\",\"http://swapi.co/api/films/2/\",\"http://swapi.co/api/films/1/\",\"http://swapi.co/api/films/7/\"],\"species\":[\"http://swapi.co/api/species/2/\"],\"vehicles\":[],\"starships\":[],\"created\":\"2014-12-10T15:11:50.376000Z\",\"edited\":\"2014-12-20T21:17:50.311000Z\",\"url\":\"http://swapi.co/api/people/3/\"}"
  },
  {
    "type": "Commit",
    "commit": {
      "type": "Eye",
      "commit": {
        "type": "LoadSuccess",
        "color": "red"
      }
    }
  }
]

The "type": "Effect" event is not changed by the composition. We can see that the "type": "Commit" events originate from the eye controller thanks to the "type": "Eye" field.
What we gain
By composing components in this way, we get isolated components which help reusability. As an illustration, the eye controller only knows about the eye state and the eye patches, so we are sure it cannot interact with other elements. We did compose the eye controller with the movies controller, but we could as well compose the eye controller with... itself:
// model.js
export type State = {
  first: EyeModel.State,
  second: EyeModel.State,
};

export type Commit = {
  type: 'First',
  commit: EyeModel.Commit,
} | {
  type: 'Second',
  commit: EyeModel.Commit,
};

// controller.js
export function* control(action: Action): Ship.Ship {
  switch (action.type) {
  case 'First':
    return yield* Ship.map(
      commit => ({type: 'First', commit}),
      state => state.first,
      EyeController.control(action.action)
    );
  case 'Second':
    return yield* Ship.map(
      commit => ({type: 'Second', commit}),
      state => state.second,
      MoviesController.control(action.action)
    );
  default:
    return;
  }
}

This is important because a component (like a form input with auto-complete) may appear several times in one web page.

docs/tutorial/testing.html.body:
Testing
In Redux Ship the testing of side effects is central, as effectful funtions are often where critical operations happen. The main idea is to use snapshot testing to simplify and automate the creation of tests. The two involved primitives are:

Ship.snap to take the snapshot of a full execution trace;
Ship.simulate to simulate a ship against an existing snapshot.

We present three kinds of snapshot testing with Redux Ship and the Jest test runner. Use the method which better fits your needs.


Test by live snapshots
Test by generated snapshots
Test by step-by-step snapshots

Test by live snapshots
The idea of test by live snapshots is:

to generate the snapshot of a live execution of a ship (clicking on the submit button of a running application for example);
to check by simulation that the snapshot is still valid as we modify our application.

If we take the http-request example and click on the button to get the color of the eye of R2-D2:

we obtain the following snapshot in the console logs (using redux-ship-logger):
{"action":{"type":"Eye","action":{"type":"Load"}},"snapshot":[{"type":"Commit","commit":{"type":"Eye","commit":{"type":"LoadStart"}}},{"type":"Effect","effect":{"type":"HttpRequest","url":"http://swapi.co/api/people/3/"},"result":"{\"name\":\"R2-D2\",\"height\":\"96\",\"mass\":\"32\",\"hair_color\":\"n/a\",\"skin_color\":\"white, blue\",\"eye_color\":\"red\",\"birth_year\":\"33BBY\",\"gender\":\"n/a\",\"homeworld\":\"http://swapi.co/api/planets/8/\",\"films\":[\"http://swapi.co/api/films/5/\",\"http://swapi.co/api/films/4/\",\"http://swapi.co/api/films/6/\",\"http://swapi.co/api/films/3/\",\"http://swapi.co/api/films/2/\",\"http://swapi.co/api/films/1/\",\"http://swapi.co/api/films/7/\"],\"species\":[\"http://swapi.co/api/species/2/\"],\"vehicles\":[],\"starships\":[],\"created\":\"2014-12-10T15:11:50.376000Z\",\"edited\":\"2014-12-20T21:17:50.311000Z\",\"url\":\"http://swapi.co/api/people/3/\"}"},{"type":"Commit","commit":{"type":"Eye","commit":{"type":"LoadSuccess","color":"red"}}}]}

This describes what happened in response to the {"type":"Eye","action":{"type":"Load"}} action. To test it with Jest, we create a file src/__tests__/controller.js containing:
// @flow
import 'babel-polyfill';
import * as Controller from '../controller';
import * as Ship from 'redux-ship';

const liveSnapshot = {"action":{"type":"Eye","action":{"type":"Load"}},"snapshot":[{"type":"Commit","commit":{"type":"Eye","commit":{"type":"LoadStart"}}},{"type":"Effect","effect":{"type":"HttpRequest","url":"http://swapi.co/api/people/3/"},"result":"{\"name\":\"R2-D2\",\"height\":\"96\",\"mass\":\"32\",\"hair_color\":\"n/a\",\"skin_color\":\"white, blue\",\"eye_color\":\"red\",\"birth_year\":\"33BBY\",\"gender\":\"n/a\",\"homeworld\":\"http://swapi.co/api/planets/8/\",\"films\":[\"http://swapi.co/api/films/5/\",\"http://swapi.co/api/films/4/\",\"http://swapi.co/api/films/6/\",\"http://swapi.co/api/films/3/\",\"http://swapi.co/api/films/2/\",\"http://swapi.co/api/films/1/\",\"http://swapi.co/api/films/7/\"],\"species\":[\"http://swapi.co/api/species/2/\"],\"vehicles\":[],\"starships\":[],\"created\":\"2014-12-10T15:11:50.376000Z\",\"edited\":\"2014-12-20T21:17:50.311000Z\",\"url\":\"http://swapi.co/api/people/3/\"}"},{"type":"Commit","commit":{"type":"Eye","commit":{"type":"LoadSuccess","color":"red"}}}]};

test('controller with live snapshot', () => {
  const {action, snapshot} = liveSnapshot;
  expect(Ship.simulate(Controller.control(action), snapshot)).toEqual(snapshot);
});

We use the primitive Ship.simulate to replay our controller and check that it replays as described by the snapshot. Notice that Ship.simulate is a pure function, that is to say the effects are not actually run but simulated. If later on we introduce an error in our code like:
case 'Load': {
  yield* Ship.commit({type: 'LoadStart'});
  const r2d2 = yield* Effect.httpRequest('http://swapi.co/api/people/3/');
  // `skin_color` instead of `eye_color`
  const eyeColor = JSON.parse(r2d2).skin_color;
  yield* Ship.commit({type: 'LoadSuccess', color: eyeColor});
  return;
}

we would get the following test error:
Expected value to equal:
      [{"commit": {"commit": {"type": "LoadStart"}, "type": "Eye"}, "type": "Commit"}, {"effect": {"type": "HttpRequest", "url": "http://swapi.co/api/people/3/"}, "result": "{\"name\":\"R2-D2\",\"height\":\"96\",\"mass\":\"32\",\"hair_color\":\"n/a\",\"skin_color\":\"white, blue\",\"eye_color\":\"red\",\"birth_year\":\"33BBY\",\"gender\":\"n/a\",\"homeworld\":\"http://swapi.co/api/planets/8/\",\"films\":[\"http://swapi.co/api/films/5/\",\"http://swapi.co/api/films/4/\",\"http://swapi.co/api/films/6/\",\"http://swapi.co/api/films/3/\",\"http://swapi.co/api/films/2/\",\"http://swapi.co/api/films/1/\",\"http://swapi.co/api/films/7/\"],\"species\":[\"http://swapi.co/api/species/2/\"],\"vehicles\":[],\"starships\":[],\"created\":\"2014-12-10T15:11:50.376000Z\",\"edited\":\"2014-12-20T21:17:50.311000Z\",\"url\":\"http://swapi.co/api/people/3/\"}", "type": "Effect"}, {"commit": {"commit": {"color": "red", "type": "LoadSuccess"}, "type": "Eye"}, "type": "Commit"}]
    Received:
      [{"commit": {"commit": {"type": "LoadStart"}, "type": "Eye"}, "type": "Commit"}, {"effect": {"type": "HttpRequest", "url": "http://swapi.co/api/people/3/"}, "result": "{\"name\":\"R2-D2\",\"height\":\"96\",\"mass\":\"32\",\"hair_color\":\"n/a\",\"skin_color\":\"white, blue\",\"eye_color\":\"red\",\"birth_year\":\"33BBY\",\"gender\":\"n/a\",\"homeworld\":\"http://swapi.co/api/planets/8/\",\"films\":[\"http://swapi.co/api/films/5/\",\"http://swapi.co/api/films/4/\",\"http://swapi.co/api/films/6/\",\"http://swapi.co/api/films/3/\",\"http://swapi.co/api/films/2/\",\"http://swapi.co/api/films/1/\",\"http://swapi.co/api/films/7/\"],\"species\":[\"http://swapi.co/api/species/2/\"],\"vehicles\":[],\"starships\":[],\"created\":\"2014-12-10T15:11:50.376000Z\",\"edited\":\"2014-12-20T21:17:50.311000Z\",\"url\":\"http://swapi.co/api/people/3/\"}", "type": "Effect"}, {"commit": {"commit": {"color": "white, blue", "type": "LoadSuccess"}, "type": "Eye"}, "type": "Commit"}]

    Difference:

    - Expected
    + Received

      Array [
        Object {
          "commit": Object {
            "commit": Object {
              "type": "LoadStart",
            },
            "type": "Eye",
          },
          "type": "Commit",
        },
        Object {
          "effect": Object {
            "type": "HttpRequest",
            "url": "http://swapi.co/api/people/3/",
          },
          "result": "{\"name\":\"R2-D2\",\"height\":\"96\",\"mass\":\"32\",\"hair_color\":\"n/a\",\"skin_color\":\"white, blue\",\"eye_color\":\"red\",\"birth_year\":\"33BBY\",\"gender\":\"n/a\",\"homeworld\":\"http://swapi.co/api/planets/8/\",\"films\":[\"http://swapi.co/api/films/5/\",\"http://swapi.co/api/films/4/\",\"http://swapi.co/api/films/6/\",\"http://swapi.co/api/films/3/\",\"http://swapi.co/api/films/2/\",\"http://swapi.co/api/films/1/\",\"http://swapi.co/api/films/7/\"],\"species\":[\"http://swapi.co/api/species/2/\"],\"vehicles\":[],\"starships\":[],\"created\":\"2014-12-10T15:11:50.376000Z\",\"edited\":\"2014-12-20T21:17:50.311000Z\",\"url\":\"http://swapi.co/api/people/3/\"}",
          "type": "Effect",
        },
        Object {
          "commit": Object {
            "commit": Object {
    -         "color": "red",
    +         "color": "white, blue",
              "type": "LoadSuccess",
            },
            "type": "Eye",
          },
          "type": "Commit",
        },
      ]

The snapshots also contain information about the concurrency of the effects. For example, if we concurrently run several ships with Ship.all we get a node:
{
  "type":"All",
  "snapshots": [...]
}

in the logs. Being explicit about the concurrency ensures deterministic tests.
We have taken the snapshot from the point of view of the whole application. Thus this snapshot tests the application controller. It can also be interesting to only test the controller of the eye component. In order to do so, we need to log the snapshots from the point of view of the eye controller by doing this modification:
// export function* control(action: Action): Ship.Ship {
export function* control2(action: Action): Ship.Ship {
  switch (action.type) {
  case 'Load': {
    [...]
  }
  default:
    return;
  }
}

import {logControl} from 'redux-ship-logger';
export const control = logControl(control2);

Then we can add a test by generated snapshot for the eye controller, as illustrated in src/eye/__tests__/controller.js.
Test by generated snapshots
The idea of test by generated snapshots is:

to write a mock of the side-effects;
to run the ships with the mock and take a snapshot of the execution.

We have at least two options to mock the effects:

to use standard tools like nock;
to write our own runEffect function.

In this example we decide to write our own runEffect function to test the controller of the eye component (see src/eye/__tests__/controller.js):
function runEffect(effect: Effect.Effect): any {
  switch (effect.type) {
  case 'HttpRequest':
    return JSON.stringify({eye_color: 'red'});
  default:
    return;
  }
}

test('controller with generated snapshot', async () => {
  const action = {type: 'Load'};
  const store = Redux.createStore(EyeModel.reduce, EyeModel.initialState);
  const ship = Ship.snap(EyeController.control(action));
  const snapshot = await Ship.run(runEffect, store, ship);
  expect(snapshot).toMatchSnapshot();
});

We define the runEffect function such that the HTTP requests always answer {eye_color: 'red'}. Since all our side-effects should be serialized and of type Effect.Effect, we are sure to handle all the effects with the runEffect function. We use a real Redux store to handle the state in the test. Then we use and Ship.run and Ship.snap to run our controller and take its snapshot. Notice that we have to do an await as Ship.run always returns a promise, even if in this case the promise resolves immediately. Finally, we save and compare the snapshot using the snapshot testing mechanism of Jest.
For information, the generated snapshot of the eye controller is the following:
exports[`test controller with generated snapshot 1`] = `
Object {
  "result": undefined,
  "snapshot": Array [
    Object {
      "commit": Object {
        "type": "LoadStart",
      },
      "type": "Commit",
    },
    Object {
      "effect": Object {
        "type": "HttpRequest",
        "url": "http://swapi.co/api/people/3/",
      },
      "result": "{\"eye_color\":\"red\"}",
      "type": "Effect",
    },
    Object {
      "commit": Object {
        "color": "red",
        "type": "LoadSuccess",
      },
      "type": "Commit",
    },
  ],
}
`;

Test by step-by-step snapshots
The idea of test step-by-step snapshots is to take a snapshot at each step of a ship. This technique was suggested by Gael du Plessix in this Gist. It also works with Redux Saga. This approach is more manual than taking the complete snapshot of a ship at once, but can provide more control. Here is an example to test the controller of the eye component:
test('controller step by step', () => {
  const action = {type: 'Load'};
  const gen = EyeController.control(action);
  expect(gen.next()).toMatchSnapshot(); // -> Commit
  expect(gen.next()).toMatchSnapshot(); // -> HTTP request
  expect(gen.next(JSON.stringify({eye_color: 'red'}))).toMatchSnapshot(); // -> Commit
  expect(gen.next()).toMatchSnapshot(); // -> Done
});

The snapshot file is the following:
exports[`test controller step by step 1`] = `
Object {
  "done": false,
  "value": Object {
    "command": Object {
      "commit": Object {
        "type": "LoadStart",
      },
      "type": "Commit",
    },
    "type": "Command",
  },
}
`;

exports[`test controller step by step 2`] = `
Object {
  "done": false,
  "value": Object {
    "command": Object {
      "effect": Object {
        "type": "HttpRequest",
        "url": "http://swapi.co/api/people/3/",
      },
      "type": "Effect",
    },
    "type": "Command",
  },
}
`;

exports[`test controller step by step 3`] = `
Object {
  "done": false,
  "value": Object {
    "command": Object {
      "commit": Object {
        "color": "red",
        "type": "LoadSuccess",
      },
      "type": "Commit",
    },
    "type": "Command",
  },
}
`;

exports[`test controller step by step 4`] = `
Object {
  "done": true,
  "value": undefined,
}
`;

docs/api.html.body:
API Reference

Ship
Snapshot
all
call
commit
getState
map
middleware
run
simulate
snap

Ship
The type of a ship. A ship is a generator and can be defined using the function* syntax.

Effect the type of the side effects the ship can call. We often use a single Effect type for a whole program
Commit the type of the commits the ship can commit
State the type of the state as visible from the ship
A the type of the value returned by the ship (often void)

Example
A controller to load a random gif:
export function* control(action: Action): Ship.Ship {
  switch (action.type) {
  case 'Load': {
    yield* Ship.commit({
      type: 'LoadStart',
    });
    const result = yield* Effect.httpRequest(
      `http://api.giphy.com/v1/gifs/random?api_key=dc6zaTOxFJmzC&tag=${action.tag}`
    );
    const gifUrl: string = JSON.parse(result).data.image_url;
    yield* Ship.commit({
      type: 'LoadSuccess',
      gifUrl,
    });
    return;
  }
  default:
    return;
  }
}

Snapshot
The type of the snapshot of an execution of a ship. A snapshot includes the side effects ran by a ship, as well as their execution order (sequential or concurrent). You can take a snapshot with the redux-ship-logger dev tools or with the snap function.

Effect the type of effects in the snapshot
Commit the type of commits in the snapshot

Example
The snapshot of a controller loading a random gif:
[
  {
    "type": "Commit",
    "commit": {
      "type": "LoadStart"
    }
  },
  {
    "type": "Effect",
    "effect": {
      "type": "HttpRequest",
      "url": "http://api.giphy.com/v1/gifs/random?api_key=dc6zaTOxFJmzC&tag=minion"
    },
    "result": [...]
  },
  {
    "type": "Commit",
    "commit": {
      "type": "LoadSuccess",
      "gifUrl": "http://media3.giphy.com/media/HyanD1KpfzPiw/giphy.gif"
    }
  }
]

all
all(
  ships: Ship[]
): Ship

Returns the array of results of the ships by running them in parallel. This is the equivalent of Promise.all in Ship.

ships an array of ships to execute concurrently

If you have a fixed number of tasks with different types of result to run in parallel, use:
all2(ship1, ship2)
all3(ship1, ship2, ship3)
...
all7(ship1, ship2, ship3, ship4, ship5, ship6, ship7)

The result type is a tuple with the same types as the arguments:
all3(
  ship1: Ship,
  ship2: Ship,
  ship3: Ship
): Ship

Example
To concurrently get three random gifs:
const gifUrls = yield* Ship.all(['cat', 'minion', 'dog'].map(function* (tag) {
  const result = yield* Effect.httpRequest(
    `http://api.giphy.com/v1/gifs/random?api_key=dc6zaTOxFJmzC&tag=${tag}`
  );
  return JSON.parse(result).data.image_url;
}));

call
call(
  effect: Effect
): Ship

Calls the serialized effect effect. The type of the result is any because it depends on the value of the effect, which is only known at runtime.

effect the effect to call

Example
To prevent type errors, we recommend to wrap your calls to call with one wrapper per kind of effect. For example, if you have an effect HttpRequest which always returns a string:
export function httpRequest(url: string): Ship {
  return Ship.call({
    type: 'HttpRequest',
    url,
  });
}

commit
commit(
  commit: Commit
): Ship

Commits a commit of type Commit and waits for its termination.

commit the commit to apply

Example
To commit the result of a successful HTTP request:
yield* Ship.commit({
  type: 'LoadSuccess',
  gifUrl,
});

getState
getState(
  selector: (state: State) => A
): Ship

Returns a part of the current state by applying a selector.

selector a selector to extract the useful part of the current state

Example
To get the current gif in the store:
const currentGif = yield* Ship.getState(state => state.randomGif.gifUrl);

map
map(
  liftCommit: (subCommit: SubCommit) => Commit,
  extractState: (state: State) => SubState,
  ship: Ship
): Ship

A function useful to compose nested components. Lifts a ship with access to "small set" of commits SubCommit and a "small set" of states SubState to a ship with access to the "larger sets" Commit and State.

liftCommit lifts a sub-commit to a commit
extractState extract a sub-state from a state
ship the ship to map

Example
To embed a controller retrieving one random gif into a controller retrieving two random gifs:
return yield* Ship.map(
  commit => ({type: 'First', commit}),
  state => state.first,
  RandomGifController.control(action.action)
);

middleware
middleware(
  runEffect: (effect: Effect) => any | Promise,
  control: (action: Action) => Ship
): ReduxMiddleware

Returns a Redux middleware to connect Redux Ship to Redux.

runEffect the function to evaluate a serialized side effect (may return a promise for asynchronous effects)
control the function to evaluate an action with a ship

The Ship middleware eats all actions: it does not let actions propagate to the next middleware. If you want an action to propagate use Ship.commit explicitly.
When a Ship.commit occurs, the commit is dispatched to the next middleware rather than to the whole middleware chain. This is so to prevent loops of commits. Thus, this is not possible to call another ship with Ship.commit. Instead, use the yield* keyword to directly call the corresponding ship.
Example
import {applyMiddleware, createStore} from 'redux';

const middlewares = [
  Ship.middleware(runEffect, control),
  otherMiddleware
];

const store = createStore(reduce, initialState, applyMiddleware(...middlewares));

run
run(
  runEffect: (effect: Effect) => any | Promise,
  store: {
    dispatch: (commit: Commit) => void | Promise,
    getState: () => State
  },
  ship: Ship
): Promise

Runs a ship and its side effects by evaluating each primitive effect with runEffect and interpreting each call to Redux with the store.

runEffect the function to evaluate a serialized side effect (may return a promise for asynchronous effects)
store the current Redux store
ship the ship to execute

Example
To run Redux Ship with a Redux store store, you can do:
Ship.run(runEffect, store, ship);

where runEffect is your function to evaluate your side effects:
export type Effect = {
  type: 'HttpRequest',
  url: string,
};

export async function runEffect(effect: Effect): Promise {
  switch (effect.type) {
  case 'HttpRequest': {
    const response = await fetch(effect.url);
    return await response.text();
  }
  default:
    return;
  }
}

simulate
simulate(
  ship: Ship,
  snapshot: Snapshot
): Snapshot

Simulates a ship in the context of a snapshot and returns the snapshot of the simulation. A simulation is a purely functional (with no side effects) execution of a ship. Useful for regression testing.

ship the ship to simulate
snapshot a snapshot of a previous execution of the ship

To simulate a ship, we need a snapshot of a previous live execution because there are many ways to execute a ship. For example, if the ship starts an API request, we do not know which API answer to provide. In this case, we use a snapshot which already contains an API answer. Since the simulation always gives the same API answers as in the snapshot, the ship should behave the same as when its snapshot was taken. In particular, the result of simulate should be equal to snapshot, unless the implementation of ship had a regression since its snapshot was taken.
Example
In a unit test of a controller:
expect(Ship.simulate(control(action), snapshot)).toEqual(snapshot);

snap
snap(
  ship: Ship
): Ship
}>

Returns a ship behaving as ship but taking the snapshot of its own execution.

ship the ship to take in picture

Example
To take the snapshot of a ship:
const {result, snapshot} = yield* Ship.snap(ship);

To take the snapshot of a controller (the result should always be undefined):
const {snapshot} = yield* Ship.snap(control(action));
